// === Create custom icon element === \\
class MyIcon extends HTMLElement {
  connectedCallback() {
    if(
      !this.getAttribute('type') 
      || !icons[this.getAttribute('type')]
    ) return;

    this.innerHTML = icons[this.getAttribute('type')] 
  }
}
// Element name "<i-></i->"
customElements.define("i-", MyIcon);


// === Inputs === \\
function applayInpuCompoStyles(input_comopo) {
  
  // Get inputBox
  let inputBox = input_comopo.querySelector('.input');

  // Get input 
  let input = input_comopo.querySelector('input');
  
  // Get input type
  let type  = input.getAttribute('type').toLowerCase()?? 'text';
  
  // === Translate input placeholder === \\ 
  let placeholder = input.getAttribute('placeholder')?? null;
  if(placeholder) input.setAttribute('placeholder', trans(placeholder));
  
  function createSeparator() {
    let separator = document.createElement('div');
    separator.classList.add('separator');
    return separator;
  }
  
  // Focus Ring
  if( inputBox && input ) {
    inputBox.addEventListener('click', event=> {
      if(event.target.tagName !== 'BUTTON') input.focus();
    })
    input.addEventListener('focusin', ()=> {
      inputBox.classList.add('focus');
    })
    input.addEventListener('focusout', ()=> {
      inputBox.classList.remove('focus');
    })
  }

  switch (type) {
    // Case to handle password input behavior
    case 'password':
      // Create a toggle button to switch input type (e.g., password to text)
      let passToggle = document.createElement('button');
      passToggle.type = 'button'; // Button type is explicitly set to avoid form submission
      passToggle.classList.add('disabled'); // Add a disabled style class initially
      passToggle.disabled = true; // Disable the button initially

      // Define icon HTML templates for lock, eye (show password), and closed-eye (hide password)
      let lockIcon = `<i- type="lock" class="vsmall"></i->`;
      let eyeIcon = `<i- type="eye" class="vsmall"></i->`;
      let closedEyeIcon = `<i- type="closed-eye" class="vsmall"></i->`;

      // Function to switch the input type between 'password' and 'text'
      function switchInputType(type = '') {
          // Function to set the input type to 'password'
          function password() {
              passToggle.innerHTML = eyeIcon; // Set toggle button to show "eye" icon
              input.type = 'password'; // Change input type to 'password'
              return true;
          }
          // Function to set the input type to 'text'
          function text() {
              passToggle.innerHTML = closedEyeIcon; // Set toggle button to show "closed-eye" icon
              input.type = 'text'; // Change input type to 'text'
              return true;
          }

          // Switch behavior based on the passed type or current input state
          switch (type) {
              case "password":
                  return password();
              case "text":
                  return text();
              default:
                  // Toggle behavior if no type is explicitly specified
                  if (input.type == 'password') {
                      text();
                      return 'switch';
                  }
                  password();
                  return "switch";
          }
      }

      // Set the default toggle icon to the "lock" icon
      passToggle.innerHTML = lockIcon;

      // Add a click event listener to the toggle button to switch the input type
      passToggle.addEventListener('click', switchInputType);

      // Update the toggle button and input behavior based on user typing
      input.addEventListener('keyup', () => {
          if (input.value == '') {
              // Reset to default state if the input is empty
              switchInputType('password');
              passToggle.innerHTML = lockIcon;
              passToggle.disabled = true; // Disable the toggle button
              passToggle.classList.add('disabled'); // Apply disabled style
              return;
          }

          // Enable the toggle button if input has a value
          passToggle.disabled = false;
          passToggle.classList.remove('disabled');

          // Update the toggle button icon based on the current input type
          if (input.type == 'password') {
              passToggle.innerHTML = eyeIcon;
              return;
          }
          passToggle.innerHTML = closedEyeIcon;
      });

      // Append the toggle button to the input container (inputBox)
      inputBox.append(passToggle);

    break;

    case "tel" : 
      const countrys = {
        'LY': {flagName: 'flag-LY', code:'+218'},
        includes : (Key)=>{
          if(Key == 'includes') return false;
          for(country in countrys) {
            if(country == Key) {return true}
          }
          return false;
        }
      };
      
      let country = input.getAttribute('country');
      country = countrys.includes(country)? countrys[country] : 'default';
      
      let separator = document.createElement('div');
      separator.classList.add('separator');
      inputBox.insertBefore(separator, input);
      
      let countryViewer = document.createElement('div');
      countryViewer.classList.add('country');
      if(country == 'default') {
          countryViewer.innerHTML = `
            <i- type="phone" class="vsmall"></i->
            <p class="txt body1">${trans('هاتف')}</p>
          `;
        } else {
          countryViewer.innerHTML = `
            <i- type="${country['flagName']}" class="vsmall"></i->
            <p class="txt body1">${country['code']}</p>
          `;
      }

      inputBox.insertBefore(countryViewer, separator);

    break;
    
    case "number":
    case "price":
      // Add 'typeNumber' class to the input element to style it as a number input
      input_comopo.classList.add('typeNumber');

      // Create a div element to act as a container for the counter buttons
      let counter = document.createElement('div');
      counter.classList.add('counter'); // Add 'counter' class for styling

      // Create the increment button and add an SVG icon to it
      let incrementBtn = document.createElement('button');
      incrementBtn.type = 'button';
      incrementBtn.innerHTML = `
        <svg width="9" height="7" viewBox="0 0 9 7" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M4.52836 0.845871L8.31133 5.60066C8.41043 5.72527 8.47357 5.8769 8.49335 6.03775C8.51313 6.19861 8.48873 6.36204 8.42301 6.50889C8.35729 6.65575 8.25297 6.77994 8.12227 6.86692C7.99158 6.9539 7.83992 7.00006 7.68508 7H0.980612C0.825854 6.99986 0.674335 6.95355 0.543793 6.86649C0.41325 6.77943 0.309086 6.65522 0.243489 6.50841C0.177892 6.3616 0.153577 6.19825 0.173393 6.03749C0.193208 5.87673 0.256332 5.7252 0.355378 5.60065L4.13733 0.845871C4.16123 0.815863 4.19112 0.791722 4.22491 0.775155C4.25869 0.758588 4.29554 0.75 4.33285 0.75C4.37015 0.75 4.407 0.758588 4.44079 0.775155C4.47457 0.791722 4.50447 0.815863 4.52836 0.845871Z" fill="currentColor"/>
        </svg>
      `;

      // Create the decrement button and add an SVG icon to it
      let decreaseBtn = document.createElement('button');
      decreaseBtn.type = 'button';
      decreaseBtn.innerHTML = `
        <svg width="9" height="7" viewBox="0 0 9 7" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M4.13835 6.15413L0.355378 1.39934C0.256278 1.27473 0.193139 1.1231 0.17336 0.962246C0.153582 0.801389 0.177983 0.63796 0.243704 0.491107C0.309425 0.344255 0.413745 0.220062 0.544439 0.133083C0.675132 0.0461032 0.826786 -6.07839e-05 0.981631 6.00665e-08H7.6861C7.84085 0.000141827 7.99237 0.0464528 8.12292 0.133512C8.25346 0.220571 8.35762 0.344776 8.42322 0.491589C8.48882 0.638403 8.51313 0.80175 8.49332 0.962511C8.4735 1.12327 8.41038 1.27479 8.31133 1.39934L4.52938 6.15413C4.50549 6.18414 4.47559 6.20828 4.4418 6.22485C4.40802 6.24141 4.37117 6.25 4.33386 6.25C4.29656 6.25 4.25971 6.24141 4.22592 6.22485C4.19214 6.20828 4.16224 6.18414 4.13835 6.15413Z" fill="currentColor"/>
        </svg>
      `;

      // Input unit \\
      let unit = input.getAttribute('unit') ?? null;
      
      // Retrieve the maximum and minimum values from the input element's attributes
      let max = parseFloat(input.getAttribute('max')) ?? null;
      let min = parseFloat(input.getAttribute('min')) ?? null;

      // Function to check if the current number is at or above the maximum
      function isMax(number) {
        if (typeof max !== 'number') return false;

        if (number >= max) {
          incrementBtn.setAttribute('disabled', '');
          incrementBtn.classList.add('disabled');
          return true;
        }
        incrementBtn.removeAttribute('disabled');
        incrementBtn.classList.remove('disabled');
        return false;
      }

      // Function to check if the current number is at or below the minimum
      function isMin(number) {
        if (typeof min !== 'number') return false;

        if (number <= min) {
          decreaseBtn.setAttribute('disabled', '');
          decreaseBtn.classList.add('disabled');
          return true;
        }
        decreaseBtn.removeAttribute('disabled');
        decreaseBtn.classList.remove('disabled');
        return false;
      }

      // Function to increase the number and validate bounds
      function incrementNumber() {
        let number = parseFloat(input.value) || 0; // Default to 0 if input is empty
        input.value = ++number; // Increment the number
        isMax(number); // Check if it's at maximum
        isMin(number); // Check if it's at minimum
      }

      // Function to decrease the number and validate bounds
      function decreaseNumber() {
        let number = parseFloat(input.value) || 0; // Default to 0 if input is empty
        input.value = --number; // Decrement the number
        isMin(number); // Check if it's at minimum
        isMax(number); // Check if it's at maximum
      }

      // Event listener for the increment button
      incrementBtn.addEventListener('click', incrementNumber);

      // Event listener for the decrement button
      decreaseBtn.addEventListener('click', decreaseNumber);

      // Event listener for the input box to validate on user input
      input.addEventListener('focusout', () => {
        let number = parseFloat(input.value) || ''; // Default to 0 if input is empty
        if (isMax(number)) input.value = max; // Correct the value if it exceeds the max
        if (isMin(number)) input.value = min; // Correct the value if it falls below the min
      });

      // Input type price //
      if(type == 'price') {
        input.type = 'number';

        const currencies = ['د.ل','ج.م'];

        let currency = document.createElement('p');
        currency.classList.add('txt','body2','bold')
        currency.innerText = trans('د.ل');
  
        inputBox.append(createSeparator(), currency);
        
        return;
      } 
      
      // Append the buttons to the counter container
      counter.append(incrementBtn, decreaseBtn);

      // Append unit element if exsists \\
      if(unit) {
        let unitElement = document.createElement('p');
        unitElement.classList.add('txt', 'body2', 'bold')
        unitElement.innerHTML = trans(unit);
        
        inputBox.append(createSeparator(), unitElement);
        return;
      }

      // buttons attribute \\
      let showBtns = input.getAttribute('buttons') ?? true;
      
      // Append the counter container to the input box
      if(showBtns != 'off') inputBox.append(counter);

    break;
    
    case "checkbox":
      // Add a specific CSS class for styling checkboxes
      input_comopo.classList.add('typeCheckbox');
      
      // Define the icons for the checkbox (unchecked and checked states)
      const checkboxIcon = `<i- class="small" type="check-box"></i->`; // Unchecked state icon
      const checkedboxIcon = `<i- class="small" style="color:var(--primary)" type="checked-box"></i->`; // Checked state icon

      // Create a button to visually represent the checkbox
      let checkboxBtn = document.createElement('button');
      checkboxBtn.type = 'button'; // Set the button type to "button"

      // Function to determine and update the checkbox status
      function inputStatus(Status = 'switch') {
        // Check the current status based on the presence of the "checked" attribute
        let status = input.getAttribute('checked') === '' ? true : false;

        // Function to set the checkbox to unchecked state
        function check() {
          input.removeAttribute('checked'); // Remove the "checked" attribute
          checkboxBtn.innerHTML = checkboxIcon; // Update the button to show the unchecked icon
          return false;
        }

        // Function to set the checkbox to checked state
        function checked() {
          input.setAttribute('checked', ''); // Add the "checked" attribute
          checkboxBtn.innerHTML = checkedboxIcon; // Update the button to show the checked icon
          return true;
        }

        // Switch logic to handle the state based on the input parameter "Status"
        switch (Status) {
          case true: // Explicitly set to checked state
            return checked();
            break;

          case false: // Explicitly set to unchecked state
            return check();
            break;

          default: // Toggle the current state
            if (status) {
              check();
              return 'switch';
            }
            checked();
            return 'switch';
        }
      }

      // Initialize the checkbox status based on the "checked" property
      inputStatus(input.checked);

      // Add a click event listener to the button to simulate a checkbox click
      checkboxBtn.addEventListener('click', () => {
        input.click(); // Trigger the input click event
      });

      // Add an input event listener to update the checkbox status when the input changes
      input.addEventListener('input', () => inputStatus(input.checked));

      // Append the button to the input's container element
      input_comopo.append(checkboxBtn);

    break;

    case 'toggle-switch':
      // Add a specific CSS class for styling the toggle switch
      input_comopo.classList.add('typeToggle-Switch');

      // Set the input type to "checkbox" for functionality
      input.type = 'checkbox';

      // Create a button element to represent the toggle switch
      let switchBtn = document.createElement('button');
      switchBtn.classList.add('toggle'); // Add a class for styling the toggle button
      switchBtn.innerHTML = '<div class="circle"></div>'; // Add a circle element for the toggle's handle
      switchBtn.type = 'button'; // Set the button type to "button" (prevents form submission)

      // Function to manage the toggle switch status
      function changeStatus(Status = 'switch') {
        // Determine the current status based on the presence of the "checked" attribute
        let input_status = input.getAttribute('checked') === '' ? true : false;

        // Function to activate the toggle switch (checked state)
        function active() {
          input.setAttribute('checked', ''); // Add the "checked" attribute
          switchBtn.classList.add('active'); // Add an "active" class for styling
          input.active = active; // Save active function in the input \\
          input.status = true; // Save status in input \\
          // Custom event "active"
          input.dispatchEvent(new CustomEvent("active", {detail: { switchToggle: switchBtn }}));
          
          return true;
        }

        // Function to deactivate the toggle switch (unchecked state)
        function inActive() {
          switchBtn.classList.remove('active'); // Remove the "active" class
          input.removeAttribute('checked'); // Remove the "checked" attribute
          input.inActive = inActive; // Save inActive function in the input \\
          input.status = false; // Save status in input \\
          // Custom event "active"
          input.dispatchEvent(new CustomEvent("inactive", {detail: { switchToggle: switchBtn }}));

          return false;
        }

        // Switch logic to handle the state based on the input parameter "Status"
        switch (Status) {
          case true: // Explicitly set to the active state
            return active();
            break;

          case false: // Explicitly set to the inactive state
            return inActive();
            break;

          default: // Toggle the current state
            if (input_status) {
              inActive();
              return 'switch';
            }
            active();
            return 'switch';
        }
      }

      // Append the toggle button to the input's container
      input_comopo.append(switchBtn);

      // Add a click event listener to the toggle button to simulate a click on the input
      switchBtn.addEventListener('click', () => {
        input.click(); // Trigger the input click event
      });

      // Add an input event listener to update the toggle status when the input changes
      input.addEventListener('input', () => changeStatus(input.checked));

      // Active input if checked 
      if(input.hasAttribute('active')){ changeStatus(true) }
      else {changeStatus(false)}

      input.removeAttribute('active'); // Remove active attribute if exsists
    break;

    case "inline":
      // Set inline class to inputbox
      input_comopo.classList.add('typeInline');
      input.type = 'text'; // Set input type to text
    break;

    case "date":
    case "datetime-local":
      // Check if there's showPicker button \\
      let showPickerBtn = inputBox.querySelector('button');
      if( showPickerBtn && showPickerBtn.isPickerBtn ) return
      
      // Add "typeDate" class to input-compo \\
      input_comopo.classList.add('typeDate');
      
      // Create showPicker handel \\
      showPickerBtn = document.createElement('button');

      // Set isPickerBtn to true \\
      showPickerBtn.isPickerBtn = true;

      // Add clinder icon \\
      showPickerBtn.innerHTML = `
        <i- class="vsmall" type="date"></i->
      `;

      // Set show handel picker \\
      showPickerBtn.addEventListener('click', ()=> input.showPicker());

      // Add picker button before input \\
      inputBox.insertBefore(showPickerBtn, input);
    break;
  }

}

// === Create custom input element === \\
class MyInput extends HTMLElement {
  connectedCallback() { 
    this.classList.add('input-compo');
    
    applayInpuCompoStyles(this);
  }
}

// Element name "<input-compo></input-compo>"
customElements.define("input-compo", MyInput);